NewsResponseModel newsResponseFromJson(String str) => NewsResponseModel.fromJson(json.decode(str));
String newsResponseToJson(NewsResponseModel data) => json.encode(data.toJson());

class NewsResponseModel {
  String? status;
  String? code;
  int? totalResults;
  String? message;
  List<ArticlesModel>? articles;

  NewsResponseModel({
      this.status, 
      this.totalResults, 
      this.articles,});

  NewsResponseModel.fromJson(dynamic json) {
    status = json['status'];
    code = json['code'];
    message = json['message'];
    totalResults = json['totalResults'];
    if (json['articles'] != null) {
      articles = [];
      json['articles'].forEach((v) {
        articles?.add(ArticlesModel.fromJson(v));
      });
    }
  }


  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    map['status'] = status;
    map['totalResults'] = totalResults;
    if (articles != null) {
      map['articles'] = articles?.map((v) => v.toJson()).toList();
    }
    return map;
  }

}